import Home from '../Home/Home';
import './App.css';
import MetaTags from 'react-meta-tags';

function App() {
  return (
    <div className="App">
      <MetaTags>
        <title>oncovid.today | Daily Ontario COVID-19 Tracking</title>
        <meta name="description" content="Daily updates for case count, tests completed, deaths, and more." />
        <meta property="og:title" content="oncovid.today" />
        <meta property="og:image" content="preview.png" />
      </MetaTags>
      <Home />
    </div>
  );
}

export default App;
